function Login(){
    return(
        <div>
            <h1>Sign In</h1>
            <form>
                <label>Username</label>
                <input/>
                <label>Password</label>
                <input/>
                <button type="submit">Login</button>
            </form>
        </div>
    )
};
export default Login;
